def entropy(D):
    if (len(D) == 0):
        return 0
    count_array=np.array(Counter(D).values())
    P=count_array/float(count_array.sum())
    H=np.dot(-P,np.log2(P))
    return H


def additem(a,arr,cnt):
    if len(arr)==0:
        arr = np.append(arr, a)
        cnt = np.append(cnt, 1)
    else:
        tmpindex=np.where(arr==a)
        if len(tmpindex[0])==0:
            arr = np.append(arr, a)
            cnt = np.append(cnt, 1)
        else:
            cnt[tmpindex[0][0]]=cnt[tmpindex[0][0]]+1
    return arr,cnt

def calcu_mean(arr,cnt):
    if (len(arr) == 0):
        return 0
    tmpmean=0
    for i in range(len(arr)):
        tmpmean=tmpmean+cnt[i]*arr[i]
    return tmpmean/np.sum(cnt)

def calcu_std(arr,cnt):
    if (len(arr) == 0):
        return 0
    mean=calcu_mean(arr,cnt)
    tmpstd=0
    for i in range(len(arr)):
        tmpstd=tmpstd+cnt[i]*(arr[i]-mean)*(arr[i]-mean)
    tmpstd=tmpstd/np.sum(cnt)
    tmpstd=math.sqrt(tmpstd)
    return tmpstd

def calcu_entropy(arr,cnt):
    if (len(arr) == 0):
        return 0
    sum=np.sum(cnt)
    tmpentropy=0
    for i in range(len(arr)):
        tmpp=cnt[i]/sum
        tmpentropy=tmpentropy-tmpp*math.log(tmpp,2)
    return tmpentropy

def returnmin(arr):
    if(len(arr)==0):
        return 0
    else:
        return arr.min()
def returnmax(arr):
    if(len(arr)==0):
        return 0
    else:
        return arr.max()


