    contFragments_ave = contFragments_ave / float(count)  # 
    protocol_num = len(protocol_arr)
    protocol_ave = calcu_mean(protocol_arr, protocol_arr_cnt)
    srcip_num = len(srcip_arr)
    srcip_entropy = calcu_entropy(srcip_arr, srcip_arr_cnt)
    dstip_num = len(dstip_arr)
    dstip_entropy = calcu_entropy(dstip_arr, dstip_arr_cnt)
    srcport_num = len(srcport_arr)
    srcport_entropy = calcu_entropy(srcport_arr, srcport_arr_cnt)
    dstport_num = len(dstport_arr)
    dstport_entropy = calcu_entropy(dstport_arr, dstport_arr_cnt)
    duration_ave = calcu_mean(duration_arr, duration_arr_cnt)
    duration_var = calcu_std(duration_arr, duration_arr_cnt)
    SrcPayloadBytes_ave = calcu_mean(SrcPayloadBytes_arr, SrcPayloadBytes_arr_cnt)
    SrcPayloadBytes_var = calcu_std(SrcPayloadBytes_arr, SrcPayloadBytes_arr_cnt)
    DestPayloadBytes_ave = calcu_mean(DestPayloadBytes_arr, DestPayloadBytes_arr_cnt)
    DestPayloadBytes_var = calcu_std(DestPayloadBytes_arr, DestPayloadBytes_arr_cnt)
    SrcTotalBytes_ave = calcu_mean(SrcTotalBytes_arr, SrcTotalBytes_arr_cnt)
    SrcTotalBytes_var = calcu_std(SrcTotalBytes_arr, SrcTotalBytes_arr_cnt)
    DestTotalBytes_ave = calcu_mean(DestTotalBytes_arr, DestTotalBytes_arr_cnt)
    DestTotalBytes_var = calcu_std(DestTotalBytes_arr, DestTotalBytes_arr_cnt)
    SrcPacketCount_ave = calcu_mean(SrcPacketCount_arr, SrcPacketCount_arr_cnt)
    SrcPacketCount_var = calcu_std(SrcPacketCount_arr, SrcPacketCount_arr_cnt)
    DestPacketCount_ave = calcu_mean(DestPacketCount_arr, DestPacketCount_arr_cnt)
    DestPacketCount_var = calcu_std(DestPacketCount_arr, DestPacketCount_arr_cnt)

    newfeature= np.array([[count,protocol_num,protocol_ave,srcip_num,srcip_entropy,dstip_num,dstip_entropy,
            srcport_num,srcport_entropy,dstport_num,dstport_entropy,
            moreFragments_ave,contFragments_ave,duration_ave,duration_var,
            SrcPayloadBytes_ave,SrcPayloadBytes_var,
            DestPayloadBytes_ave,DestPayloadBytes_var,
            SrcTotalBytes_ave,SrcTotalBytes_var,
            DestTotalBytes_ave,DestTotalBytes_var,
            SrcPacketCount_ave,SrcPacketCount_var,
            DestPacketCount_ave,DestPacketCount_var,recordForceOut_exist
            ]], dtype=np.float32)
    return newfeature,newdatafeature(newfeature)
